import React from "react";
import ReactDOM from "react-dom";
import Navbar from "./NavBar";
import Search from "./Search";

function HomePage() {
    return (
        <div>
            <Navbar></Navbar>
            <Search></Search><br></br>
            <center>
            <table>
                <tr>
                    <td>Date</td>
                    <td>Error Header</td>
                    <td>Error</td>
                </tr>
            </table>
            </center>
        </div>
    );

}

export default HomePage;
